const block2 = (context) => { return html`<th class="ui5-table-select-all-column" role="presentation" aria-hidden="true"><${scopeTag("ui5-checkbox", tags, suffix)} class="ui5-table-select-all-checkbox" ?checked="${context._allRowsSelected}" @ui5-change="${ifDefined(context._selectAll)}" aria-label="${ifDefined(context.ariaLabelSelectAllText)}"></${scopeTag("ui5-checkbox", tags, suffix)}></th>`; };
const block3 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>`; };
const block4 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>`; };
