const block6 = (context) => { return html`<tr class="ui5-table-no-data-row-root" role="row"><td colspan="${ifDefined(context.visibleColumnsCount)}" role="cell"><div class="ui5-table-no-data-row"><span>${ifDefined(context.noDataText)}</span></div></td></tr>`; };
const block7 = (context) => { return html`<tr><td colspan="${ifDefined(context.visibleColumnsCount)}"><div growing-button><div tabindex="0" role="button" aria-labelledby="${ifDefined(context.loadMoreAriaLabelledBy)}" ?active="${context._loadMoreActive}" @click="${context._onLoadMoreClick}" @keydown="${context._onLoadMoreKeydown}" @keyup="${context._onLoadMoreKeyup}" growing-button-inner><span id="${ifDefined(context._id)}-growingButton-text" growing-button-text>${ifDefined(context._growingButtonText)}</span>${ context.growingButtonSubtext ? block8(context) : undefined }</div></div></td></tr>`; };
const block8 = (context) => { return html`<span id="${ifDefined(context._id)}-growingButton-subtext" growing-button-subtext>${ifDefined(context.growingButtonSubtext)}</span>`; };
const block9 = (context) => { return html`<tr tabindex="-1" class="ui5-table-end-row"><td tabindex="-1"><span tabindex="-1" aria-hidden="true" class="ui5-table-end-marker"></span></td></tr>`; };


	return block0(context);
};

export default main;
